import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import RepositoryScreen from "../../screens/RepositoryScreen";
import HomeScreen from "../../screens/HomeScreen"

/* Aca van las pantallas que se tienen en el tab-navigation */

const RepoStack = createNativeStackNavigator();

function HomeStackScreen() {
  return (
    <RepoStack.Navigator>
      <RepoStack.Screen name="Repositorios" component={HomeScreen} />
      <RepoStack.Screen name="Details" component={RepositoryScreen} />
    </RepoStack.Navigator>
  );
}
export default HomeStackScreen;
